import React, { Component } from 'react';
import classes from './TestUI.module.css';
import Carousel from 'react-bootstrap/Carousel';

class TestUI extends Component {
    render() {
        return (

            // <div className={classes.pagination}>
            //     <button className={classes.button} >1</button>


            //     <button className={classes.button} >2</button>
            //     <button className={classes.button} >3</button>
            //     <div className={classes.downArrow}>

            //         <div className={classes.bounce}>
            //             <img width="40" height="40" alt="" src="data:image/svg+xml;base64," /></div>

            //     </div>
            // </div>

<Carousel fade>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src="holder.js/800x400?text=First slide&bg=373940"
      alt="First slide"
    />
    <Carousel.Caption>
      <h3>First slide label</h3>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src="holder.js/800x400?text=Second slide&bg=282c34"
      alt="Second slide"
    />

    <Carousel.Caption>
      <h3>Second slide label</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src="holder.js/800x400?text=Third slide&bg=20232a"
      alt="Third slide"
    />

    <Carousel.Caption>
      <h3>Third slide label</h3>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>

        );
    };
}

export default TestUI;
